import React from 'react';
import './PlacesDisplay.css'; // Make sure to create this CSS file

const PlacesDisplay = ({ places }) => {
  return (
    <div className="places-container">
      {places.map((place, index) => (
        <div key={index} className="place-card">
          <img src={place.imageUrl} alt={place.name} className="place-image" />
          <h3 className="place-name">{place.name}</h3>
          //<p className="place-info">{place.info}</p>
          {/* Add more details as needed */}
        </div>
      ))}
    </div>
  );
};

export default PlacesDisplay;
